import React from 'react'
import Button from '../components/Button'
import logo from '/home/dckap/Documents/React/practice/src/assests/images/Onboarding-rafiki 1.png'

export default function Signup() { 
  return (
    <div className=''>
       <div className='flex '>
          <div className='bg-primary w-1/2 h-screen'>
             <img src={logo} className='pt-12' />
           </div>
           <div className='bg-secondary w-1/2'>
              <div className='pt-12 px-32 space-y-3'>
                  <h2 className='text-textPrimary font-bold text-2xl'>Welcome to Knowledge Base! ðŸ‘‹</h2>
                  <h3 className='text-textPrimary'>Please sign into your account</h3>

              <form class="space-y-2" action="#" method="POST">
              <div>
                <label for="username" className="text-textPrimary text-base	">Username <span className='text-red-500'>*</span></label>
                <div class="mt-2">
                  <input id="username" name="username" type="text" autocomplete="off" required class="w-96 h-9 rounded-lg placeholder:text-gray-400 " />
                </div>
              </div>
              <div>
                <label for="email" class="text-textPrimary text-base	">Email <span className='text-red-500'>*</span></label>
                <div class="mt-2">
                  <input id="email" name="email" type="email" autocomplete="email" required class="w-96 h-9 rounded-lg border-slate-900" />
                </div>
              </div>
              <div>
                <label for="password" class="text-textPrimary text-base	">Password <span className='text-red-500'>*</span></label>
                <div class="mt-2">
                  <input id="password" name="password" type="password" autocomplete="email" required class="w-96 h-9 rounded-lg border-orange-600" />
                </div>
              </div>
              <div>
                <label for="confirmPassword" class="text-textPrimary text-base	">Confirm Password <span className='text-red-500'>*</span></label>
                <div class="mt-2">
                  <input id="confirmPassword" name="confirmPassword" type="password" autocomplete="email" required class="w-96 h-9 rounded-lg border-slate-900" />
                </div>
              </div>

              <div>
                <Button name="Signup"/>
              </div>
            </form>
            <div className='space-x-1'>
              <span>
              Already have an Account? 
              </span>
              <span className='text-primary'>
                Login Here
              </span>
            </div>
            <div>
              <Button name="Signup with google"/>
              </div>
            </div>
          </div>
        </div>
    </div>

  )
}






